package Eps;

public class LongNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		long valuewithoutL = 365 * 24 * 60 * 60 * 1000;

		System.out.println(valuewithoutL);

		long valuewithL = 365 * 24 * 60 * 60 * 1000l;

		System.out.println(valuewithL);

	}

}
